        /* Image classes */
        .Img-TapMatchingSymbol {
            background-image: var(--img-TapMatchingSymbol);
        }

        .Img-Match2More {
            background-image: var(--img-Match2More);
        }

        .Img-Card1 {
            background-image: var(--img-Card1);
        }

        .Img-Card2 {
            background-image: var(--img-Card2);
        }

        .Img-Card3 {
            background-image: var(--img-Card3);
        }

        .Img-Card4 {
            background-image: var(--img-Card4);
        }

        .Img-Star{
            mask-image: var(--img-Star);
        }

        .Img-Twinkle{
            mask-image: var(--img-Twinkle);
        }

        /* Particles */
        #physicsWrapper{
            position: absolute;
            width: 100%;
            height: 100%;
            overflow: hidden;
            top: 0px;
            pointer-events: none;            
        }

        #physicsWrapper2
        {
            position: fixed;
            width: 100vw;
            height: 100vh;
            overflow: hidden;
            top: 0px;
            left: 0px;
            pointer-events: none;            
        }

        #canvas {
            width: 100%;
            height: 100%;
            position: absolute;
            top: 0;
            left: 0;
            pointer-events: none;            
        }

        #canvas2 {
            width: 100vw;
            height: 100vh;
            position: fixed;
            top: 0;
            left: 0;
            pointer-events: none;            
        }
        
        .particle {
            position: absolute;                                                
            transform-origin: 50% 50%;
            border-radius: 50%;;
            background-position: center;
            background-size: contain;
        }
        
        /* Body */
        html, body {
            margin: 0;
            padding: 0;
            height: 100%;
            width: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
            background: #000;
            overflow: hidden;
        }

        /* Main containers */
        #introScreen {
            background-color: #FFDF3D;
            width: calc(100vh * 720 / 1280);
            height: 100vh;
            max-width: 100%;
            position: absolute;
            pointer-events: none;
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            align-content: center;
            background-size: 70%;
            background-repeat: repeat; /* or no-repeat if you dont want tiling */
            animation: bgScroll 10s linear infinite;
            /* Tiled bg pattern */
            background-image: var(--img-TiledBgPattern);
        }

        #main-content {
            background-color: black;
            width: calc(100vh * 720 / 1280);
            height: 100vh;
            max-width: 100%;
            background-size: cover;
            background-position: center;
            display: flex;
            flex-direction: column;
            position: relative;
            /* Dobblys village*/
            background-image: var(--img-DobblysVillage);
        }

        #endScreen {
            background-color: rgba(0,0,0,.7);
            width: calc(100vh * 720 / 1280);
            height: 100vh;
            max-width: 100%;
            position: absolute;
            opacity: 0;
            transition: opacity 1s ease;
            pointer-events: none;
        
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            align-content: center;                
        }

        @media (max-width: 720px) {
            #main-content {
                width: 100vw;
                height: calc(100vw * 1280 / 720);
            }
        
            #endScreen {
                width: 100vw;
                height: calc(100vw * 1280 / 720);
            }
        
            #introScreen {
                width: 100vw;
                height: calc(100vw * 1280 / 720);
            }
        }

        /* Intro screen elements */
        .logo {
            background-image: var(--img-DobblyLoading);
            background-size: contain;
            background-position: center;
            width: 100%;
            height: 30%;
            background-repeat: no-repeat;
            animation: punchShow .3s;
            z-index: 2;
        }

        .spotTheMatch {
            background-image: var(--img-DobbleGo2Lines);
            background-size: contain;
            background-position: center;
            width: 100%;
            height: 20%;
            background-repeat: no-repeat;
            animation: punchShow .5s;
            z-index: 2;
        }

        .credits{
            display:flex;
            justify-content:space-evenly;
            
            height: 10%;
            background-image: var(--img-CreditBar);
            background-size: cover;
            background-position: center;
            background-repeat: no-repeat;
        }

        .creditsImg{
            width:100px;
            height: auto;
            object-fit: contain;
            flex-shrink: 0;
            background-size: contain;
            background-position: center;
            background-repeat: no-repeat;
        }

        .zygomatic {
            background-image: var(--img-Zygomatic);
        }

        .asmodee {
            background-image: var(--img-Asmodee);
        }

        .amuzo {
            background-image: var(--img-Amuzo);
        }

        #transition {
            background-image: var(--img-Transition);
            background-size: contain;
            background-position: center;
            background-repeat: no-repeat;
            align-self: center;
            position: absolute;
            width: 125vh;
            aspect-ratio: 1;
            z-index: 10;

            transform: scale(0);
        }

        @keyframes transitionAnim{
            0%{
                transform: scale(0) rotateZ(-90deg)
            }
        
            40% {
                transform: scale(1) rotateZ(0deg)
            }
        
            60% {
                transform: scale(1) rotateZ(0deg)
            }
        
            100% {
                transform: scale(0) rotateZ(90deg)
            }
        }

        @keyframes bgScroll {
            0% {
                background-position: 0 0;
            }
        
            100% {
                background-position: -720px 720px; /* how far to scroll */
            }
        }

        /* Main screen elements */
        .cardContainer {
            height: 50%;
            width: 100%;
            display: grid;
            justify-items: center;
            align-items: center;
        }

        .card {
            height: 80%;
            aspect-ratio: 1;
            margin: 10%;
            background-size: contain;
            transition: transform 0.5s ease;
            display: flex;
            justify-content: center;
            align-content: center;
            grid-area: 1 / 1;
            transform: scale(.8,.8);
        }

        .glow {
            height: 135%;
            aspect-ratio: 1;    
            position: absolute;
            background-size: contain;
            top: -17.5%;
            background-blend-mode: screen;
            opacity: .3;
            animation: glow 2s infinite;
            pointer-events: none;
            background-image: var(--img-Glow);
        }

        @keyframes glow{
            0%{
                opacity: .5;
            }
        
            50% {
                opacity: 0;
            }
        
            100% {
                opacity: .5;
            }
        }

        .hotSpotPadding {
            width: 100%;    
        }

        .hotSpot{
            height: 100%;
            width: 100%;                
        }

        #textOverlay {
            position: absolute;    
            width: 80%;
            height: 20%;
            background-size: contain;
            background-repeat: no-repeat;
            top: 40%;
            align-self: center;
            transform-origin: 50% 50%;
            transform: scale(0);
        }

        #dobblyHand {
            position: absolute;
            background-image: var(--img-DobblyHand);
            background-size: contain;
            background-repeat: no-repeat;
            width: 20%;
            height: 20%;
            top: 60%;
            left: 55%;
            opacity: 0;
            transition: opacity 1s ease;
            animation: dobblyHand 1s infinite;
            pointer-events: none;
        }

        @keyframes dobblyHand{
            0% {
                transform: scale(.8) rotateZ(0deg);
            }
        
            50% {
                transform: scale(1.2) rotateZ(20deg);
            }
        
            70% {
                transform: scale(.8) rotateZ(-10deg);
            }
        
            100% {
                transform: scale(.8) rotateZ(0deg);
            }
        }

        /* End screen elements */
        #levelCompleteSplash {
            width: 100%;
            height: 150px;
            align-self: center;
            background-image: var(--img-Winner);
            background-size: contain;
            background-position: center;
            background-repeat: no-repeat;
            z-index: 2;
        }

        #nextLevelButton {
            width: 100%;
            height: 120px;
            align-self: center;
            background-image: var(--img-NextButton);
            background-size: contain;
            background-position: center;
            background-repeat: no-repeat;
            z-index: 2;
        }

        /* Reusable */
        .pulse {
            animation: pulseGlow 1.2s infinite;
        }

        @keyframes pulseGlow {
            0% {
                transform: scale(1);        
            }
        
            70% {
                transform: scale(1.2);              
            }
        
            100% {
                transform: scale(1);        
            }
        }

        @keyframes punchShow {
            0% {
                transform: scale(0);
            }
        
            70% {
                transform: scale(1.2);
            }
        
            100% {
                transform: scale(1);
            }
        }

        @keyframes punchHide {
            0% {
                transform: scale(1);
            }
        
            30% {
                transform: scale(1.2);
            }
        
            100% {
                transform: scale(0);
            }
        }
    </style>

    <!-- Global -->
    <canvas id="canvas"></canvas>
    <div id="physicsWrapper"></div>

    <script>
        //Tools
        function waitForSeconds(seconds) {
            return new Promise(resolve => setTimeout(resolve, seconds * 1000));
        }
        
        function Clamp(value, min, max) {
            return Math.min(Math.max(value, min), max);
        }
        
        function vectorToRadians(v) {
            return Math.atan2(v.y, v.x);
        }
        
        function randomRange(start, end) {
            return Math.random() * (end - start) + start;
        }
    
        //Curves
        function quadraticCurve(t) {
            return 1 - Math.abs(2 * t - 1);
        }

        //Classes        
        class Vector2 {
            constructor(x = 0, y = 0) {
                this.x = x;
                this.y = y;
            }
        
            //Mutators
            MTranslate(v){
                this.x += v.x;
                this.y += v.y;
                return this;
            }
        
            MMultiply(scaler){
                this.x *= scaler;
                this.y *= scaler;
                return this;
            }
        
            MClamp(min, max){
                this.x = Clamp(this.x, min, max);
                this.y = Clamp(this.y, min, max);
                return this;
            }
        
            //Non mutating
            Multiply(scaler){
                return new Vector2(this.x * scaler, this.y * scaler);
            }
        
            Subtract(v){
                return new Vector2(this.x - v.x, this.y - v.y)
            }    

            Magnitude() {
                return Math.sqrt(this.x * this.x + this.y * this.y);
            }
        
            Normalize() {
                const mag = this.Magnitude();
                if (mag === 0) return new Vector2(0, 0);
                return new Vector2(this.x / mag, this.y / mag);
            }
        }

        class ParticleSystem{
            constructor({lifetime = null, speed = 0, startSize = null, color = null, gravityModifier = 0, linearDrag = .5, burstCount = 1, texture = null, 
                useTrail = true, relativeTrailWidth = 1,
                useOpacityOverLifetime = false, 
                sizeOverLifetimeCurve = null} = {})
            {
                this.lifetime = lifetime;
                this.speed = speed;
                this.startSize = startSize;        
                this.color = color;
                this.gravityModifier = gravityModifier;
                this.linearDrag = linearDrag;
                this.burstCount = burstCount;
                this.texture = texture;
                this.useTrail = useTrail;
                this.relativeTrailWidth = relativeTrailWidth;
                this.useOpacityOverLifetime = useOpacityOverLifetime;
                this.sizeOverLifetimeCurve = sizeOverLifetimeCurve;
            }
        
            CreateBurst(location)
            {
                //Fragment is utilised to allow all elements to be added to the DOM in one operation
                //This allows for less reflow and better performance
                const fragment = document.createDocumentFragment();
            
                for(let i = 0; i < this.burstCount; i++)
                {
                    //---------------------------------------------------------------------------------
                    //SETUP VARS
                    //---------------------------------------------------------------------------------
                
                    //Lifetime
                    let pLifeTime = 0;
                    if (this.lifetime instanceof Vector2)
                        pLifeTime = randomRange(this.lifetime.x, this.lifetime.y);
                    else
                        pLifeTime = this.lifetime;
                
                    //Speed
                    let pSpeed = 0;
                    if (this.speed instanceof Vector2)
                        pSpeed = randomRange(this.speed.x, this.speed.y);
                    else
                        pSpeed = this.speed;
                
                    //Size
                    let pStartSize = 0;
                    if (this.startSize instanceof Vector2)
                        pStartSize = randomRange(this.startSize.x, this.startSize.y);
                    else
                        pStartSize = this.startSize;
                
                    //Color
                    let pColor = null;
                    if (this.color instanceof Array)
                        pColor = this.color[Math.floor(Math.random() * this.color.length)];            
                    else
                        pColor = this.color;
                
                    //Gravity modifier
                    let pGravity = 9.8 * this.gravityModifier;
                
                    //---------------------------------------------------------------------------------
                    //CREATE PARTICLE
                    //---------------------------------------------------------------------------------
                
                    let nextParticle = new Particle({
                        position: new Vector2(location.x, location.y),
                        velocity: new Vector2(randomRange(-1,1), randomRange(-1,1)).Normalize().Multiply(pSpeed),
                        lifeTime: pLifeTime,
                        startSize: pStartSize,
                        color: pColor,
                        gravity: pGravity,
                        linearDrag: this.linearDrag,
                        useTrail: this.useTrail,
                        relativeTrailWidth: this.relativeTrailWidth,
                        texture: this.texture,
                        useOpacityOverLifetime: this.useOpacityOverLifetime,
                        parentFragment: fragment,
                        sizeOverLifetimeCurve: this.sizeOverLifetimeCurve,
                    });
                
                    particles.push(nextParticle);
                }
            
                //Append all particles to DOM
                physicsWrapper.appendChild(fragment);
            }
        }

        class Particle{
            constructor({
                position = null,
                velocity = null,
                lifeTime = null,
                startSize = null,
                color = null,
                texture = null,
                gravity = null,
                linearDrag = 0.5,
                useTrail = false,
                relativeTrailWidth = 1,
                useOpacityOverLifetime = false,
                sizeOverLifetimeCurve = null,
                parentFragment = null,
            } = {}) 
            {
                //Tags
                this.dead = false;
            
                //Physics
                this.position = position;
                this.velocity = velocity;
                this.gravity = gravity;
                this.linearDrag = linearDrag;
            
                //Life
                this.lifeTime = lifeTime;
                this.age = 0;
            
                //Color modifiers
                this.useOpacityOverLifetime = useOpacityOverLifetime;
                this.opacity = 1;
            
                //Size
                this.sizeOverLifetimeCurve = sizeOverLifetimeCurve;
                this.startSize = startSize;
                this.size = startSize;
            
                //Object
                this.object = document.createElement("div");
                this.object.classList.add("particle");
                this.object.style = `width: ${startSize}px; height: ${startSize}px;`;
            
                if (texture != null) 
                {
                    //Support for inlined files
                    if (texture.startsWith("url("))
                        this.object.style.maskImage = texture;
                    else if (texture.startsWith("Img-"))
                        this.object.classList.add(texture);

                    this.object.style.maskSize = "contain";
                    this.object.style.maskPosition = "center";
                    this.object.style.maskRepeat = "no-repeat";
                }
            
                this.object.style.backgroundColor =`rgb(${color.r}, ${color.g}, ${color.b})`;
            
                if (parentFragment != null)
                    parentFragment.appendChild(this.object);
                else
                    physicsWrapper.appendChild(this.object);
            
                //Trail parameters
                this.useTrail = useTrail;
                this.trail = [];
                this.trailColor = color;
                this.relativeTrailWidth = relativeTrailWidth;
                this.maxTrailLength = 20;
            }

            TickParticle(deltaTime)
            {
                //Check lifetime
                if (this.lifeTime != 0){
                    this.age += deltaTime;
                    if (this.age >= this.lifeTime)
                    {
                        this.dead = true;
                        return;
                    }
                }    
            
                //Calculate velocity and position
                this.velocity.MTranslate(new Vector2(0, this.gravity * deltaTime));        
                this.velocity.MClamp(-terminalVelocity, terminalVelocity);
                this.velocity.MMultiply(1 - this.linearDrag * deltaTime);//Apply linear drag
                this.position.MTranslate(this.velocity.Multiply(pixelsPerMeter)); //Apply final translation        
            
                //Bounds check
                if (this.position.y > window.innerHeight + this.maxTrailLength * terminalVelocity)
                    this.dead = true;
            
                //Apply styles
                if (this.object != null)
                {
                    const halfWidth = this.object.offsetWidth / 2;
                    const halfHeight = this.object.offsetHeight / 2;
                    this.object.style.transform = `translate(${this.position.x }px, ${this.position.y}px) translate(-50%, -50%) rotate(${vectorToRadians(this.velocity)}rad)`;
                }
            
                //Update trail
                if (this.useTrail)
                    this.UpdateTrail();
            
                //Update opcaity
                if (this.useOpacityOverLifetime){
                    this.opacity = 1 - Math.pow((this.age / this.lifeTime), 3); //Cubic fade
                    this.object.style.opacity = this.opacity;
                }
            
                //Update size
                if (this.sizeOverLifetimeCurve != null){            
                    this.size = this.startSize * this.sizeOverLifetimeCurve(this.age / this.lifeTime);                    
                    this.object.style.width = `${this.size}px`;
                    this.object.style.height = `${this.size}px`;
                }
            }
        
            UpdateTrail()
            {
                //Update position history
                this.trail.push(new Vector2(this.position.x, this.position.y));    
                if (this.trail.length > this.maxTrailLength)
                    this.trail.shift();

                // Draw trail with fading alpha for each segment
                if (this.trail.length > 1) {            
                    for (let i = 0; i < this.trail.length - 1; i++) {
                        const p0 = this.trail[i];
                        const p1 = this.trail[i + 1];
                        //Alpha increases towards tail
                        const alpha = ((i + 1) / this.trail.length) * this.opacity; // 0..0.9
                        ctx.lineWidth = ((i + 1) / this.trail.length) * (this.size * this.relativeTrailWidth);
                        ctx.strokeStyle = `rgba(${this.trailColor.r}, ${this.trailColor.g}, ${this.trailColor.b}, ${alpha})`;
                        ctx.beginPath();
                        ctx.moveTo(p0.x, p0.y);
                        ctx.lineTo(p1.x, p1.y);
                        ctx.stroke();
                    }
                }
            }
        }

        //Consts
        const root = document.documentElement;

        const appLinks = {
            Android: 'https://play.google.com/store/apps/details?id=com.amuzo.dobble.spot.it.go&pcampaignid=web_share',
            iOS: 'https://apps.apple.com/gb/app/dobble-go/id6642701382',
        };

        const textOverlayClassRefs = [
            "Img-TapMatchingSymbol",      
            "Img-Match2More",            
        ];
        const cardClassRefs = [
            "Img-Card1",
            "Img-Card2",
            "Img-Card3",
            "Img-Card4"
        ];
        const symbolLayouts = [
            { top: "5%", right: "37%", bottom: "67%", left: "42%" }, //Round 1
            { top: "65%", right: "25%", bottom: "12%", left: "53%" }, //Round 1
            { top: "30%", right: "62%", bottom: "45%", left: "10%" }, //Round 2
            { top: "15%", right: "15%", bottom: "57%", left: "60%" }, //Round 2

            { top: "60%", left: "55%"},

        //Variables
        var cardIndex = -1; //DEFAULT = -1   Incremented by CreateNextCard
        var cards = [];
        var hotSpotPadding = [];

        //Unfocus safety
        var isFocused = true;
        let wasPlaying = new Map();

        //Particle perameters
        var lastTime = 0;        
        const physicsWrapper = document.getElementById("physicsWrapper");
        const physicsWrapper2 = document.getElementById("physicsWrapper2");
        const gravity = 10; //Gravities acceleration is 9.8m/s
        const pixelsPerMeter = 3;
        const terminalVelocity = 79; //Terminal velocity of a bowling ball is 79m/s
        const linearDrag = .5;
        var particles = [];        

        //Canvas perameters
        var canvas = null;
        var ctx = null;
        var  canvas2 = null;
        var ctx2 = null      

        //Event listeners
        document.addEventListener("visibilitychange", function() 
        {            
            if (document.hidden) 
            {
                isFocused = false;
                
                console.log("Hidden");
                wasPlaying.set(bgMusic, !bgMusic.paused);
                bgMusic.pause();
                
                wasPlaying.set(matchStartSfx, !matchStartSfx.paused);
                matchStartSfx.pause();

                wasPlaying.set(matchSfx, !matchSfx.paused);
                matchSfx.pause();

                wasPlaying.set(winSfx, !winSfx.paused);
                winSfx.pause();
            } 
            else 
            {
                isFocused = true;
                
                if (wasPlaying.get(bgMusic)) bgMusic.play().catch(err => console.log("Music play failed:", err));
                if (wasPlaying.get(matchStartSfx)) matchStartSfx.play().catch(err => console.log("Music play failed:", err));
                if (wasPlaying.get(matchSfx)) matchSfx.play().catch(err => console.log("Music play failed:", err));
                if (wasPlaying.get(winSfx)) winSfx.play().catch(err => console.log("Music play failed:", err));
            }
        });

        //Main functions
        function StartGame()
        {
            //Play bg music
            bgMusic.play();

            //Setup canvas
            canvas = document.getElementById('canvas');
            ctx = canvas.getContext('2d');
            canvas.width = window.innerWidth;
            canvas.height = window.innerHeight;

            canvas2 = document.getElementById('canvas2')
            ctx2 = canvas2.getContext('2d');
            canvas2.width = window.innerWidth;
            canvas2.height = window.innerHeight;

            //Initalize particles
            InitParticleLibrary();

            //Enable particles
            lastTime = performance.now();
            requestAnimationFrame(LoopParticles);

            //Create initial card    
            CreateNextCard();
            NextRound();
        
            setTimeout(() => {
                TransitionToGame();
            }, 800); //1500    
        
            setTimeout(() => {
                ShowDobblyHand();
                ShowTextOverlay();
            }, 2000); //3300
        }

        function TransitionToGame() {
            const introScreen = document.getElementById("introScreen");
            const transition = document.getElementById("transition");
        
            transition.style.animation = "transitionAnim 1.2s forwards";
        
            setTimeout(() => {
                introScreen.style.visibility = "hidden";
                matchStartSfx.play();
            }, 500);
        }

        function NextRound()
        {
            //Validate
            if (cardIndex+1 >= cardClassRefs.length) {
                EndGame();
                return;
            }    
        
            //Move round
            ShiftCurrentCards();
            CreateNextCard();
            UpdateHotspotPadding();
        
            //Hide unused cards
            if (cards.length > 2) {
                cards[2].style.opacity = "0";
            }
        
            //Hide overlays
            HideDobblyHand(true);
        
            if (cardIndex >=2)
                HideTextOverlay(true);
        }

        function CreateNextCard()
        {
            //Increment card index
            cardIndex++;
        
            //Create new card
            const newCard = document.createElement("div");
            newCard.classList.add("card");
            newCard.classList.add(cardClassRefs[cardIndex]); //For bg    
        
            //Parent to container
            const cardContainerTop = document.getElementById("cardContainerTop");
            cardContainerTop.appendChild(newCard);
        
            //Create hotspot padding
            const newHotSpotPadding = document.createElement("div");
            newHotSpotPadding.classList.add("hotSpotPadding");
            hotSpotPadding.unshift(newHotSpotPadding);
        
            //Create hotspot
            const newHotspot = document.createElement("div");
            newHotspot.classList.add("hotSpot");

            //Parent
            newCard.appendChild(newHotSpotPadding);
            newHotSpotPadding.appendChild(newHotspot);
        
            //Add event listener to hotspot
            newHotspot.addEventListener("click", (e) => {
                if (!isFocused)
                    return;        

                starParticle.CreateBurst(new Vector2(e.clientX, e.clientY));
                NextRound();
                matchSfx.play()
            });
        
            //Add to array
            cards.unshift(newCard);
        }

        function UpdateHotspotPadding()
        {
            //Calculate indexes
            var bottomIndex = (cardIndex-1)*2;
            var topIndex = bottomIndex + 1;
        
            //Setup bottom hotspot    
            bottomHotSpot = hotSpotPadding[1];
            bottomHotSpot.style.paddingTop = symbolLayouts[bottomIndex].top;
            bottomHotSpot.style.paddingRight = symbolLayouts[bottomIndex].right;
            bottomHotSpot.style.paddingBottom = symbolLayouts[bottomIndex].bottom;
            bottomHotSpot.style.paddingLeft = symbolLayouts[bottomIndex].left;
        
            //Setup top hotspot    
            topHotSpot = hotSpotPadding[0]
            topHotSpot.style.paddingTop = symbolLayouts[topIndex].top;
            topHotSpot.style.paddingRight = symbolLayouts[topIndex].right;
            topHotSpot.style.paddingBottom = symbolLayouts[topIndex].bottom;
            topHotSpot.style.paddingLeft = symbolLayouts[topIndex].left;
        }

        function ShiftCurrentCards() //FUNCTION MUST BE RAN BEFORE CREATING A CARD
        {
            //Get active card and switch parent container
            const cardToMove = cards[0];
            const cardContainerBottom = document.getElementById("cardContainerBottom");
            cardContainerBottom.appendChild(cardToMove);
        
            //Adjust to fit in top container
            cardToMove.style.transition = "none";
            cardToMove.style.transform = "translate(0, -125%) scale(.8,.8)";

            //Force apply style
            cardToMove.offsetHeight; //Reading offsetHeight forces a reflow
        
            //Apply transition and move in place
            cardToMove.style.transition = "transform .5s ease, opacity 1s ease";
            cardToMove.style.transform = "translate(0, 0) scale(1,1)";
        
            //Give glow
            const newGlow = document.createElement("div");
            newGlow.classList.add("glow");
            cardToMove.appendChild(newGlow);
        }

        async function EndGame() {
        
            //Play win sound
            winSfx.play();

            //Hide overlays
            cardIndex = -1;
            HideDobblyHand(false);
            HideTextOverlay();
        
            //Wait .5
            await waitForSeconds(.25)
        
            //Scale down cards
            for (var i = 0; i < cards.length; i++) {
                cards[i].style.animation = "punchHide .7s forwards";
            }
        
            await waitForSeconds(1)
        
            //Show end screen
            const endScreen = document.getElementById("endScreen");
            endScreen.style.opacity = "1";
            endScreen.style.pointerEvents = "all";
        
            const levelCompleteSplash = document.getElementById("levelCompleteSplash");
            levelCompleteSplash.style.animation = "punchShow .6s";

            RandomParticleLoop();
        
            //Add click event to redirect button
            const nextLevelButton = document.getElementById("nextLevelButton");
            nextLevelButton.addEventListener("click", () => {
                const isApple = /Mac|iPhone|iPad|iPod/i.test(navigator.userAgent);
            
                if (isApple)
                    mraid.open(appLinks.iOS);      
                else
                    mraid.open(appLinks.Android);                   
            });
        }

        function RandomParticleLoop()
        {
            const endScreen = document.getElementById('endScreen');
            const rect = endScreen.getBoundingClientRect();
        
            const randomX = rect.left + Math.random() * rect.width;
            const randomY = rect.top + Math.random() * rect.height;
            quickBurst.CreateBurst(new Vector2(randomX, randomY));
            starBurst.CreateBurst(new Vector2(randomX, randomY));  
            confettiParticle.CreateBurst(new Vector2(randomX, randomY));
            confettiStarParticle.CreateBurst(new Vector2(randomX, randomY));   

            setTimeout(() => 
            {                
                RandomParticleLoop();
            }, randomRange(200, 500));
        }        

        //Particles        
        function LoopParticles(currentTime)
        {    
            //Calculate deltaTime
            let deltaTime = (currentTime - lastTime) / 1000; //Current time is provided in ms
            lastTime = currentTime;
        
            //Clear canvas
            ctx.clearRect(0, 0, canvas.width, canvas.height);
            ctx2.clearRect(0, 0, canvas.width, canvas.height);
        
            //Tick all particles    
            particles.forEach((_,i)=>particles[i].TickParticle(deltaTime));    
        
            //Destroy dead particles
            for(let i=particles.length-1;i>=0;i--){
                if(particles[i].dead){
                    particles[i].object?.remove?.();
                    particles.splice(i,1);
                }
            }
        
            //Run function again on next frame
            requestAnimationFrame(LoopParticles);
        }

        //Shower Hiders
        function ShowDobblyHand() {
            const dobblyHand = document.getElementById("dobblyHand");
            dobblyHand.style.top = dobblyHandLayout[cardIndex - 1].top;
            dobblyHand.style.left = dobblyHandLayout[cardIndex - 1].left;
            dobblyHand.style.opacity = "1";
        }

        function HideDobblyHand(reAppear) {
            const dobblyHand = document.getElementById("dobblyHand");
            dobblyHand.style.opacity = "0";
        
            let currentCardIndex = cardIndex;
        
            if (reAppear) {
                setTimeout(() => {
                    if (currentCardIndex == cardIndex)
                        ShowDobblyHand();
                }, 2500);
            }    
        }

        function ShowTextOverlay() {
            if (cardIndex-1 >= textOverlayClassRefs.length)
                return

            const textOverlay = document.getElementById("textOverlay");            
            textOverlay.classList.add(textOverlayClassRefs[cardIndex - 1]); //Img swap
            textOverlay.style.animation = "punchShow .4s forwards";
        }

        function HideTextOverlay(reAppear) {
            const textOverlay = document.getElementById("textOverlay");
            textOverlay.style.animation = "punchHide .4s forwards";
        
            let currentCardIndex = cardIndex;
        
            if (reAppear) {
                setTimeout(() => {
                    if (currentCardIndex == cardIndex)
                        ShowTextOverlay();
                }, 1000);
            }
        }

        //MRAID Initialization
        function MraidInitialization()
        {
            if (typeof mraid === "undefined") 
            {
                console.log("Not in an MRAID environment yet.");                
                StartGame();
                return;
            }
        
            if (typeof mraid !== "undefined") 
            {
                if (mraid.getState() === "loading")             
                    mraid.addEventListener("ready", onMraidReady); 
                else
                    onMraidReady();
            }
        }

        function onMraidReady() 
        {                  
            //Wait for viewable state
            mraid.addEventListener("viewableChange", function(isViewable) {
                if (isViewable) {
                    StartGame();
                }
            });
        
            //If viewable already
            if (mraid.isViewable()) {
                StartGame();
            }
        }

        MraidInitialization();
    </script>

</body>
    </html>
